import { checkfor, checkforstudent } from "./func.js"

export class student {
    constructor(lev, star, name){
        this.lev=lev                    //레벨
        this.star=star                  //성급
        this.name=name                  //이름
        this.stuNum = checkforstudent(stu_list,name)
        this.stab = stu_list[this.stuNum][1]
        this.atk1 = stu_list[this.stuNum][2]
        this.atkMax = stu_list[this.stuNum][3]
        this.hp1 = stu_list[this.stuNum][4]
        this.hpMax = stu_list[this.stuNum][5]
        this.def1 = stu_list[this.stuNum][6]
        this.defMax = stu_list[this.stuNum][7]
        this.heal1 = stu_list[this.stuNum][8]
        this.healMax = stu_list[this.stuNum][9]
        this.evade = stu_list[this.stuNum][10]
        this.acc = stu_list[this.stuNum][11]
        this.CRate = stu_list[this.stuNum][12]
        this.CRes = stu_list[this.stuNum][13]
        this.CDmg = stu_list[this.stuNum][14]
        this.CdmRes = stu_list[this.stuNum][15]
        this.BlockRate = stu_list[this.stuNum][16]
        this.range = stu_list[this.stuNum][17]
        this.urban = stu_list[this.stuNum][18]
        this.outdoor = stu_list[this.stuNum][19]
        this.indoor = stu_list[this.stuNum][20]
        this.equip1 = stu_list[this.stuNum][21]
        this.equip2 = stu_list[this.stuNum][22]
        this.equip3 = stu_list[this.stuNum][23]
        this.ccup = 100
        this.ccres = 100
        
        this.bonus_times_atk = 0        // % 보너스 공격
        this.bonus_times_hp = 0
        this.bonus_times_def = 0
        this.bonus_times_heal = 0
        this.bonus_times_evade = 0
        this.btcr = 0
        this.bonus_times_CDmg = 0
        this.bonus_times_acc = 0
        this.bonus_times_ccres = 0
        this.bonus_times_ccup = 0
        this.bonus_times_Cres = 0
        this.bonus_times_Cdmres = 0
        
        this.bonus_sum_atk = 0          // + 보너스 공격
        this.bonus_sum_hp = 0
        this.bonus_sum_def = 0
        this.bonus_sum_heal = 0
        this.bonus_sum_evade = 0
        this.bonus_sum_CRate = 0
        this.bonus_sum_CDmg = 0
        this.bonus_sum_acc = 0
        this.bonus_sum_Cres = 0
        this.bonus_sum_Cdmres = 0
        this.bonus_sum_ccup = 0
        this.bonus_sum_ccres = 0

        this.equip1_detail = ""
        this.equip2_detail = ""
        this.equip3_detail = ""

        if (this.star == 1 ) {
            this.atk_star = 0
            this.hp_star = 0
            this.heal_star = 0
        } else if (this.star == 2) {
            this.atk_star = 0.1
            this.hp_star = 0.05
            this.heal_star = 0.075
        } else if (this.star == 3) {
            this.atk_star = 0.22
            this.hp_star = 0.12
            this.heal_star = 0.175
        } else if (this.star == 4) {
            this.atk_star = 0.36
            this.hp_star = 0.21
            this.heal_star = 0.295
        } else if (this.star == 5) {
            this.atk_star = 0.53
            this.hp_star = 0.35
            this.heal_star = 0.445
        }
        
        this.atk=Math.ceil(((this.atk1-this.atkMax)*(lev-1)/(-99)+this.atk1)*(1+this.atk_star))
        this.hp=Math.ceil(((this.hp1-this.hpMax)*(lev-1)/(-99)+this.hp1)*(1+this.hp_star))
        this.def=Math.ceil(((this.def1-this.defMax)*(lev-1)/(-99)+this.def1))
        this.heal=Math.ceil(((this.heal1-this.healMax)*(lev-1)/(-99)+this.heal1)*(1+this.heal_star))
    }

    bonus_equip(equip_name, equip_lev, equip_list) {
        var full_name =  "T"+String(equip_lev)+equip_name
        var check = checkfor(equip_list, full_name)

        if (check[1]) {
            this.bonus_times_atk += equip_list[check[0]][1]
            this.bonus_times_hp += equip_list[check[0]][3]
            this.bonus_times_def += equip_list[check[0]][5]
            this.bonus_times_heal += equip_list[check[0]][7]
            
            this.bonus_times_ccres += equip_list[check[0]][12]
            this.bonus_times_ccup += equip_list[check[0]][11]

            
            this.bonus_sum_atk += equip_list[check[0]][2]
            this.bonus_sum_hp += equip_list[check[0]][4]
            this.bonus_sum_def += equip_list[check[0]][6]
            this.bonus_sum_heal += 0
            this.bonus_sum_CRate += equip_list[check[0]][8]
            this.bonus_sum_CDmg += equip_list[check[0]][9]
            this.bonus_sum_acc += equip_list[check[0]][10]
            this.bonus_sum_Cres += equip_list[check[0]][13]
            this.bonus_sum_Cdmres += equip_list[check[0]][14]

            if( check[0] <=19 ) {
                var i = 1

                while (i < 17) {
                    if (equip_list[check[0]][i] != 0){
                        if (equip_list[1][i]){
                            this.equip1_detail += equip_list[0][i]+" "+parseFloat((equip_list[check[0]][i]*100).toFixed(2))+"%<br>"
                        } else {
                            this.equip1_detail += equip_list[0][i]+" "+equip_list[check[0]][i]+"<br>"
                        }
                    }
                    i+=1
                }
            } else if (check[0] <=37) {
                var i = 1

                while (i < 17) {
                    if (equip_list[check[0]][i] != 0){
                        if (equip_list[1][i]){
                            this.equip2_detail += equip_list[0][i]+" "+parseFloat((equip_list[check[0]][i]*100).toFixed(2))+"%<br>"
                        } else {
                            this.equip2_detail += equip_list[0][i]+" "+equip_list[check[0]][i]+"<br>"
                        }
                    }
                    i+=1
                }
            } else {
                var i = 1

                while (i < 17) {
                    if (equip_list[check[0]][i] != 0){
                        if (equip_list[1][i]){
                            this.equip3_detail += equip_list[0][i]+" "+parseFloat((equip_list[check[0]][i]*100).toFixed(2))+"%<br>"
                        } else {
                            this.equip3_detail += equip_list[0][i]+" "+equip_list[check[0]][i]+"<br>"
                        }
                    }
                    i+=1
                }
            }
        }


    }
    bonus_bond(stu_name, bond_lev, bond_list) {
        if (bond_lev < 2) {
            return 0
        }

        var full_name = stu_name+bond_lev
        var check = checkfor(bond_list, full_name)

        switch (bond_list[check[0]][1]) {
            case "HP":
                this.bonus_sum_hp+=bond_list[check[0]][2]
                break
            case "Attack":
                this.bonus_sum_atk+=bond_list[check[0]][2]
                break
            case "Healing":
                this.bonus_sum_heal+=bond_list[check[0]][2]
                break
        }

        switch (bond_list[check[0]][3]) {
            case "HP":
                this.bonus_sum_hp+=bond_list[check[0]][4]
                break
            case "Attack":
                this.bonus_sum_atk+=bond_list[check[0]][4]
                break
            case "Healing":
                this.bonus_sum_heal+=bond_list[check[0]][4]
                break
        }

      
    }

    bonus_cal(){
        this.atk = (this.atk+this.bonus_sum_atk)*(1+this.bonus_times_atk)
        this.hp = (this.hp+this.bonus_sum_hp)*(1+this.bonus_times_hp)
        this.def = (this.def+this.bonus_sum_def)*(1+this.bonus_times_def)
        this.heal = (this.heal+this.bonus_sum_heal)*(1+this.bonus_times_heal)
        this.evade = (this.evade+this.bonus_sum_evade)*(1+this.bonus_times_evade)
        this.CRate = (this.CRate+this.bonus_sum_CRate)*(1+this.btcr)
        this.CDmg = (this.CDmg*100+this.bonus_sum_CDmg)*(1+this.bonus_times_CDmg)/100
        this.CRes = (this.CRes+this.bonus_sum_Cres)*(1+this.bonus_times_Cres)
        this.CdmRes = (this.CdmRes+this.bonus_sum_Cdmres)*(1+this.bonus_times_Cdmres)
        this.ccup = (this.ccup+this.bonus_sum_ccup)*(1+this.bonus_times_ccup)
        this.ccres = (this.ccres+this.bonus_sum_ccres)*(1+this.bonus_times_ccres)
        this.acc = (this.acc+this.bonus_sum_acc)*(1+this.bonus_times_acc)
    }
}

